import React from 'react';
import { Navbar, Main, Product, Footer } from "../components";

function Home({ cartItemCount }) {
  return (
    <>
      <Navbar cartItemCount={cartItemCount} />
      <Main />
      <Product />
      <Footer />
    </>
  );
}

export default Home;
